            background-size: cover; /* پوشش کامل پس‌زمینه */
            background-position: center; /* مرکز تصویر */
            margin: 0;
            padding: 0;
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        .container {
            display: flex;
            flex-direction: column;
            align-items: center;
            background: rgba(255, 255, 255, 0.9); /* پس‌زمینه نیمه شفاف برای فرم‌ها */
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.2);
            text-align: center; /* مرکز قرار دادن متن */
        }
        .form-container {
            margin: 10px 0;
            width: 300px; /* عرض ثابت برای فرم‌ها */
        }
        input, button {
            width: 100%;
            padding: 10px;
            margin: 5px 0;
            border: 1px solid #ccc;
            border-radius: 5px;
        }
        .navigation {
            margin-bottom: 20px;
        }
        .navigation button {
            width: auto;
            margin: 0 5px;
        }
        .welcome-message {
            margin-bottom: 20px;
            font-size: 1.2em; /* اندازه بزرگ‌تر برای پیام خوش‌آمدگویی */
            color: #333;
        }
    </style>

<body>

<div class="container">
    <h1>دست فروشی</h1> <!-- عنوان برنامه -->
    <div class="welcome-message">
        !به بازار دست فروش‌ها خوش آمدید!<br>
        همین حالا دست‌فروشی خودتو راه بنداز
    </div>

    <div class="navigation">
        <button onclick="showSection('register')">ثبت نام</button>
        <button onclick="showSection('login')">ورود</button>
        <button onclick="showSection('profile')">حساب کاربری</button>
        <button onclick="showSection('ads')">آگهی‌ها</button>
        <button onclick="showSection('support')">پشتیبانی</button>
    </div>

    <div class="form-container" id="register" style="display: none;">
        <h2>ثبت نام</h2>
        <form id="registrationForm">
            <input type="text" id="username" placeholder="نام کاربری" required>
            <input type="email" id="email" placeholder="ایمیل" required>
            <input type="password" id="password" placeholder="رمز عبور" required>
            <button type="submit">ثبت نام</button>
        </form>
    </div>

    <div class="form-container" id="login" style="display: none;">
        <h2>ورود</h2>
        <form id="loginForm">
            <input type="email" id="loginEmail" placeholder="ایمیل" required>
            <input type="password" id="loginPassword" placeholder="رمز عبور" required>
            <button type="submit">ورود</button>
        </form>
    </div>

    <div class="form-container" id="profile" style="display: none;">
        <h2>حساب کاربری</h2>
        <p>اطلاعات حساب کاربری شما اینجا نمایش داده می‌شود.</p>
    </div>

    <div class="form-container" id="ads" style="display: none;">
        <h2>آگهی‌ها</h2>
        <form id="adForm">
            <input type="text" id="adTitle" placeholder="عنوان کالا" required>
            <input type="text" id="adDescription" placeholder="توضیحات" required>
            <input type="number" id="adPrice" placeholder="قیمت" required>
            <button type="submit">ارسال آگهی</button>
        </form>
    </div>

    <div class="form-container" id="support" style="display: none;">
        <h2>پشتیبانی</h2>
        <form id="supportForm">
            <input type="text" id="supportMessage" placeholder="پیام شما" required>
            <button type="submit">ارسال پیام</button>
        </form>
    </div>
</div>

<script>
    function showSection(section) {
        const sections = ['register', 'login', 'profile', 'ads', 'support'];
        sections.forEach(sec => {
            document.getElementById(sec).style.display = sec === section ? 'block' : 'none';
        });
    }

    document.getElementById('registrationForm').addEventListener('submit', function(event) {
        event.preventDefault();
        alert('کاربر ثبت نام شد!');
    });

    document.getElementById('loginForm').addEventListener('submit', function(event) {
        event.preventDefault();
        alert('ورود موفقیت‌آمیز بود!');
    });

    document.getElementById('adForm').addEventListener('submit', function(event) {
        event.preventDefault();
        alert('آگهی ارسال شد!');
    });

    document.getElementById('supportForm').addEventListener('submit', function(event) {
        event.preventDefault();
        alert('پیام پشتیبانی ارسال شد!');
    });
</script>

</body>
</html>
